            <ul className={css.headerList}>
              <li className={css.Item}>
                <Link className={css.Link} to="/">
                  Home
                </Link>
              </li>
              <li>
                <Link className={css.Link} to="movies">
                  Movies
                </Link>
              </li>
            </ul>
          </nav> */}
        </div>
      </header>
      <main className={css.main}>
        <Suspense>
          <Outlet />
        </Suspense>
      </main>
    </>
  );
};

export default Layout;
